var vzDemo = vzDemo || {};

vzDemo.profile_image = {
    updateProfile : function(image) {
        var req = opensocial.newDataRequest();
        var viewer = opensocial.newIdSpec( {
            "userId" : "VIEWER",
            "groupId" : "SELF"
        });
        var person = opensocial.newPerson({newPhotoData : image});
        req.add(req.newUpdatePersonRequest(viewer, person));
        req.send(function(response){log.debug(response)});
    }
};

vzDemo.profile_image.image = '';


vzDemo.profile_image.controller = {
    bindProfileImage : function() {
        $('#changeProfileImage').unbind('click').bind('click', function() {
            vzDemo.profile_image.updateProfile(vzDemo.profile_image.image);
        });
    }
};